script: |
  super -f text -I q6362.spq | sort > q6362.out

inputs:
  - name: q6362.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 + + col0 BETWEEN col1 * 51 AND col1 + + col2 + - col2 + + 68;
  - name: tab2

outputs:
  - name: q6362.out
    data: |
      46	51	23
      64	77	40
      75	67	58
